"use strict";(self.webpackChunkspanish_prototype=self.webpackChunkspanish_prototype||[]).push([[9654],{9654:e=>{e.exports=JSON.parse('{"lessonId":"B1_U89","title":"\u0423\u0440\u043e\u043a 89: \u041a\u043e\u0441\u0432\u0435\u043d\u043d\u0430\u044f \u0440\u0435\u0447\u044c (2): \u0432\u043e\u043f\u0440\u043e\u0441\u044b","level":"B1","components":[{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u041a\u043e\u0441\u0432\u0435\u043d\u043d\u0430\u044f \u0440\u0435\u0447\u044c: \u0432\u043e\u043f\u0440\u043e\u0441\u044b","content":[{"text":"<strong>`Si vas a ir a la sierra el domingo` \u0438 `cu\xe1ndo \xedbamos a reunirnos` \u2014 \u044d\u0442\u043e \u043f\u0440\u0438\u043c\u0435\u0440\u044b \u0432\u043e\u043f\u0440\u043e\u0441\u043e\u0432 \u0432 \u043a\u043e\u0441\u0432\u0435\u043d\u043d\u043e\u0439 \u0440\u0435\u0447\u0438.</strong>"},{"table":{"headers":[],"rows":[["<strong>preguntar</strong>","+ si<br>+ interrogativo","Me pregunt\xf3 <strong>si</strong> ten\xeda novio.<br>Le pregunt\xe9 <strong>c\xf3mo</strong> se llamaba su hermano.<br>Me pregunt\xf3 <strong>d\xf3nde</strong> viv\xeda."]]}},{"text":"<strong>\u041d\u0430\u0438\u0431\u043e\u043b\u0435\u0435 \u0447\u0430\u0441\u0442\u044b\u0439 \u0433\u043b\u0430\u0433\u043e\u043b \u0434\u043b\u044f \u0432\u0432\u0435\u0434\u0435\u043d\u0438\u044f \u043a\u043e\u0441\u0432\u0435\u043d\u043d\u044b\u0445 \u0432\u043e\u043f\u0440\u043e\u0441\u043e\u0432 \u2014 `preguntar`. \u0422\u0430\u043a\u0436\u0435 \u043c\u043e\u0433\u0443\u0442 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c\u0441\u044f `querer saber`, `desear saber`, `(me, te...) gustar\xeda saber`.</strong>"}]},{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u0418\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u0435 \u0432\u0440\u0435\u043c\u0435\u043d \u0432 \u043a\u043e\u0441\u0432\u0435\u043d\u043d\u044b\u0445 \u0432\u043e\u043f\u0440\u043e\u0441\u0430\u0445","content":[{"table":{"headers":["\u041f\u0440\u044f\u043c\u0430\u044f \u0440\u0435\u0447\u044c","\u041a\u043e\u0441\u0432\u0435\u043d\u043d\u0430\u044f \u0440\u0435\u0447\u044c"],"rows":[["- `Quiere saber... / Ha preguntado...`<br>... si <strong>hablas</strong> espa\xf1ol.<br>... qu\xe9 <strong>est\xe1s haciendo</strong>.","- `Quer\xeda saber... / Pregunt\xf3...`<br>... si <strong>hablabas/hablas</strong> espa\xf1ol.<br>... qu\xe9 <strong>estabas/est\xe1s</strong> haciendo."],["- `Quiere saber... / Ha preguntado...`<br>... si <strong>ha acabado</strong> el cuadro.<br>... ad\xf3nde <strong>fuimos</strong> el domingo.","- `Quer\xeda saber... / Pregunt\xf3...`<br>... si <strong>hab\xeda acabado</strong> el cuadro.<br>... ad\xf3nde <strong>hab\xedamos ido</strong> el domingo."],["- `Quiere saber... / Ha preguntado...`<br>... cu\xe1ndo <strong>ser\xe1</strong> el examen.<br>... si <strong>vamos</strong> a ir a la sierra el domingo.","- `Quer\xeda saber... / Pregunt\xf3...`<br>... cu\xe1ndo <strong>ser\xeda/ser\xe1</strong> el examen.<br>... si <strong>\xedbamos</strong> a ir a la sierra el domingo."],["- `Quiere saber... / Ha preguntado...`<br>... si <strong>ser\xeda</strong> mejor quedar otro d\xeda.<br>... qu\xe9 <strong>har\xedamos</strong> en caso de que hiciera mal tiempo.","- `Quer\xeda saber... / Pregunt\xf3...`<br>... si <strong>ser\xeda</strong> mejor quedar otro d\xeda.<br>... qu\xe9 <strong>har\xedamos</strong> en caso de que hiciera mal tiempo."]]}}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 89.1: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u0441\u043e\u043e\u0431\u0449\u0435\u043d\u0438\u044f \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u043e\u0442\u0432\u0435\u0442\u0447\u0438\u043a\u0430","tasks":[{"id":"u89_1_1","sentence":"1. (Raquel a Patricia: \xbfD\xf3nde ha comprado el libro sobre Cuba?) \u2192 Patricia, soy Raquel. Quiero saber ___.","answer":"d\xf3nde has comprado el libro sobre Cuba"},{"id":"u89_1_2","sentence":"2. (Su padre a Ferm\xedn: \xbfCu\xe1ndo le va a devolver el coche?) \u2192 ___","answer":"Ferm\xedn, soy su padre. Quiero saber cu\xe1ndo me va a devolver el coche"},{"id":"u89_1_3","sentence":"3. (Ernesto a Susana: \xbfVa a venir al concierto esta noche?) \u2192 ___","answer":"Susana, soy Ernesto. Quiero saber si va a venir al concierto esta noche"},{"id":"u89_1_4","sentence":"4. (Fede a Toni: \xbfD\xf3nde vive Laura?) \u2192 ___","answer":"Toni, soy Fede. Quiero saber d\xf3nde vive Laura"},{"id":"u89_1_5","sentence":"5. (Ismael a su madre: \xbfPuede cuidar a los ni\xf1os esta noche?) \u2192 ___","answer":"Mam\xe1, soy Ismael. Quiero saber si puede cuidar a los ni\xf1os esta noche"},{"id":"u89_1_6","sentence":"6. (Lolo a Ana: \xbfEst\xe1 ocupada el s\xe1bado?) \u2192 ___","answer":"Ana, soy Lolo. Quiero saber si est\xe1 ocupada el s\xe1bado"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 89.2: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u0444\u0440\u0430\u0437\u044b \u0441 \u0433\u043b\u0430\u0433\u043e\u043b\u043e\u043c \u0432 \u0441\u043a\u043e\u0431\u043a\u0430\u0445","tasks":[{"id":"u89_2_1","sentence":"1. El domingo vi a Carlos y le pregunt\xe9 (\u201c\xbfTienes novia?\u201d) si ___ novia.","answer":"ten\xeda"},{"id":"u89_2_2","sentence":"2. Ayer me llam\xf3 Jes\xfas. Quer\xeda saber (\u201c\xbfCu\xe1ndo lo vas a llamar?\u201d) ___.","answer":"cu\xe1ndo lo iba a llamar"},{"id":"u89_2_3","sentence":"3. Hace unos d\xedas me llam\xf3 Ana. Quer\xeda saber (\u201c\xbfQu\xe9 hace Ram\xf3n?\u201d) ___.","answer":"qu\xe9 hac\xeda Ram\xf3n"},{"id":"u89_2_4","sentence":"4. Ayer vi a Lola. Me pregunt\xf3 (\u201c\xbfQu\xe9 vais a hacer este verano?\u201d) ___.","answer":"qu\xe9 \xedbamos a hacer ese verano"},{"id":"u89_2_5","sentence":"5. Esta ma\xf1ana llam\xf3 Alberto. Quer\xeda saber (\u201c\xbfOs gustar\xeda salir el s\xe1bado?\u201d) ___.","answer":"si nos gustar\xeda salir el s\xe1bado"},{"id":"u89_2_6","sentence":"6. Ayer tuve carta de \xc1ngela. Quer\xeda saber (\u201c\xbfPor qu\xe9 has dejado el trabajo?\u201d) ___.","answer":"por qu\xe9 hab\xeda dejado el trabajo"},{"id":"u89_2_7","sentence":"7. El lunes llam\xe9 al administrador para preguntarle (\u201c\xbfQui\xe9n pagar\xe1 el arreglo de la cocina?\u201d) ___.","answer":"qui\xe9n pagar\xeda el arreglo de la cocina"},{"id":"u89_2_8","sentence":"8. Ayer tuvimos una llamada de la polic\xeda. Quer\xedan saber (\u201c\xbfHan visto a alguien sospechoso por el barrio?\u201d) ___.","answer":"si hab\xedamos visto a alguien sospechoso por el barrio"},{"id":"u89_2_9","sentence":"9. Esta ma\xf1ana me pregunt\xf3 Luisa (\u201c\xbfTe llam\xf3 \xc1ngel anoche?\u201d) ___.","answer":"si me hab\xeda llamado \xc1ngel anoche"},{"id":"u89_2_10","sentence":"10. Ayer le pregunt\xe9 a Adolfo (\u201c\xbfD\xf3nde conociste a Silvia?\u201d) ___.","answer":"d\xf3nde hab\xeda conocido a Silvia"}]},{"type":"TheoryBlock","title":"\u041f\u0440\u0438\u043c\u0435\u0447\u0430\u043d\u0438\u0435: \u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 89.3","content":[{"text":"<strong>\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 89.3 \u043f\u0440\u043e\u043f\u0443\u0449\u0435\u043d\u043e, \u0442\u0430\u043a \u043a\u0430\u043a \u043e\u043d\u043e \u0442\u0440\u0435\u0431\u0443\u0435\u0442 \u0441\u0432\u043e\u0431\u043e\u0434\u043d\u043e\u0433\u043e \u0441\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u0440\u0430\u0441\u0441\u043a\u0430\u0437\u0430.</strong>"}]}]}')}}]);